  useEffect(()=>{
axios
.get('/api/profile', {
    headers: {
        Authorization: `Bearer ${localStorage.getItem('token')}`
      },
})
.then(response => {
    console.log(response.data)
    setData(response.data)
})
}, [])


    return(
        <> 
        <ProfileNav/>
            <div className="container">
                <div className="row">
                    <div className="col-12">
                    <h1>This is your profile page: {this.state.email} </h1>
                    </div>
                </div>

            </div>

            </>


    );
}
